import React, { useState , useEffect, useCallback } from 'react';
import styled from 'styled-components';
import MobileCard from '../components/MobileCard';

const PageContainer = styled.div`
  width: 100%;
  max-width: 390px;
  margin: 0 auto;
  padding: 20px 10px; // 좌우 패딩을 줄임
  background-color: #f8f9fa;
  height: 100vh; // 뷰포트 높이만큼 설정
`;

const Title = styled.h1`
  font-size: 24px;
  margin-bottom: 20px;
  margin-top: 50px;
`;

const FilterContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 10px;
  margin-bottom: 20px;
`;

const FilterButton = styled.button`
  padding: 8px 12px;
  border: 1px solid #ddd;
  border-radius: 20px;
  background-color: ${props => props.active ? '#ffd43b' : 'white'};
  color: ${props => props.active ? 'black' : '#333'};
  font-size: 14px;
  cursor: pointer;
`;

const SortContainer = styled.div`
  display: flex;
  gap: 10px;
  margin-bottom: 20px;
`;
const PostsContainer = styled.div`
  flex: 1;
  overflow-y: auto;
  padding: 0 20px 20px;
`;
const Header = styled.div`
  padding: 20px;
`;


const Divider = styled.hr`
  border: none;
  border-top: 1px solid #e0e0e0;
  margin: 15px 0;
`;


const MobilePostList = () => {
    const [posts, setPosts] = useState([]);
    const [activeFilter, setActiveFilter] = useState('전체');
    const [activeSort, setActiveSort] = useState('인기순');

    const countryInfo = {
      전체: { flag: '🌍' },
      캐나다: { flag: '🇨🇦' },
      호주: { flag: '🇦🇺' },
      뉴질랜드: { flag: '🇳🇿' },
      영국: { flag: '🇬🇧' },
      네덜란드: { flag: '🇳🇱' },
      독일: { flag: '🇩🇪' },
    };

    const fetchPosts = useCallback(() => {
      // 실제로는 여기서 API 호출을 통해 데이터를 가져올 것입니다.
      return [
        { id: 1, title: '캐나다 밴쿠버 여행 후기', likes: 42, author: '여행자123', date: '2023-07-15', content: '밴쿠버의 아름다운 자연과 도시 풍경을 소개합니다.', country: '캐나다' },
        { id: 2, title: '호주 시드니 오페라 하우스 탐방', likes: 38, author: '문화탐험가', date: '2023-07-20', content: '시드니의 상징, 오페라 하우스를 둘러봤습니다.', country: '호주' },
        { id: 3, title: '독일 베를린 장벽 투어', likes: 55, author: '역사buff', date: '2023-08-05', content: '베를린 장벽의 역사와 현재 모습을 소개합니다.', country: '독일' },
        { id: 4, title: '영국 런던 빅벤 야경', likes: 60, author: '야경사진가', date: '2023-08-10', content: '런던의 상징 빅벤의 아름다운 야경을 담았습니다.', country: '영국' },
        { id: 5, title: '독일 뮌헨 맥주 축제', likes: 70, author: '맥주애호가', date: '2023-09-15', content: '세계적으로 유명한 뮌헨 맥주 축제 체험기입니다.', country: '독일' },
      ];
    }, []);

    useEffect(() => {
      setPosts(fetchPosts());
    }, [fetchPosts]);

    const sortPosts = useCallback((postsToSort) => {
      return [...postsToSort].sort((a, b) => {
        if (activeSort === '인기순') {
          return b.likes - a.likes;
        } else {
          return new Date(b.date) - new Date(a.date);
        }
      });
    }, [activeSort]);

    const filteredAndSortedPosts = useCallback(() => {
      let filtered = activeFilter === '전체' ? posts : posts.filter(post => post.country === activeFilter);
      return sortPosts(filtered);
    }, [posts, activeFilter, sortPosts]);

    return (
      <PageContainer>
        <Header>
          <Title>커뮤니티</Title>
          <FilterContainer>
            {Object.entries(countryInfo).map(([country, info]) => (
              <FilterButton 
                key={country} 
                active={activeFilter === country}
                onClick={() => setActiveFilter(country)}
              >
                {info.flag} {country}
              </FilterButton>
            ))}
          </FilterContainer>
          <Divider />
          <FilterContainer>
            {['인기순', '최신순'].map(sort => (
              <FilterButton 
                key={sort} 
                active={activeSort === sort}
                onClick={() => setActiveSort(sort)}
              >
                {sort}
              </FilterButton>
            ))}
          </FilterContainer>
        </Header>
        <PostsContainer>
          {filteredAndSortedPosts().map(post => (
            <MobileCard key={post.id} {...post} />
          ))}
        </PostsContainer>
      </PageContainer>
    );
  };

export default MobilePostList;
